import React, { Component } from 'react';
import Identicon from 'identicon.js';
import walletphoto from '../img/wallet.png'

import avatar from '../img/car.png';
function AuthNavBar() {
        return (
        <div className="NavBar">
            <nav className="nav">
                <div className="profile">
                    <img src={avatar} alt=""/>
                 </div>

                <ul className="nav-items">
                    <li className="nav-item">
                    Crypt Ridez &emsp;&emsp;&emsp;
          <img src={walletphoto} width="30" height="30" className="d-inline-block align-top" alt="" />
          &nbsp;{this.props.balance}&nbsp;Ethers

                    </li>

                    <li className="nav-item">
                                        <small className="text-secondary">
                                  <small id="account">&nbsp;</small>
                                </small>
                                <small className="text-secondary">
                                  <small id="account">{this.props.account}</small>
                                </small>
                                { this.props.account
                                  ? <img
                                    className='ml-2'
                                    width='30'
                                    height='30'
                                    src={`data:image/png;base64,${new Identicon(this.props.account, 30).toString()}`}
                                  />  
                                  : <span></span>
                                }
                        </li>
                        {/* <li className="nav-item">
                        <NavLink className="nav-link" to="/signup" exact>
                            Sign Up
                            </NavLink>

                        </li> */}

                    {/* <li className="nav-item">
                        <NavLink to="/bookride" exact activeClassName="active">
                            Book Ride
                        </NavLink>
                    </li> */}
                    {/* <li className="nav-item">
                        <NavLink to="/history" exact activeClassName="active">
                            Ride History
                        </NavLink>
                    </li> */}
                </ul>

                <footer className="footer">
                    <p>
                        @RIDE SHARING
                    </p>
            </footer>
            </nav>

        </div>)
    }

export default AuthNavBar;








